caption.text:
People can meet in many certain ways, probably from mutual friends or random encounters. And I’m really glad that I met many kinds of people along the way. It’s like adding a new chapter in your book, and you know that your story won’t get boring anytime soon. Or maybe if you’re lucky, you can share one book to write together with that special person.

